import React from 'react';
import { Typography, Box } from '@mui/material';

const OrderStatus = ({ status }) => {
  return (
    <Box>
      <Typography variant="body1" style={{ visibility: status ? 'visible' : 'hidden' }}>
        {status || 'Статус'}
      </Typography>
    </Box>
  );
};

export default OrderStatus;
